mapper.select:

select 

from t_enterprise_list


    CODE = #{code,jdbcType=VARCHAR}


    AND EXCHANGE_CODE = #{exchangeCode,jdbcType=INTEGER}


    AND NAME = #{name,jdbcType=VARCHAR}


    AND LATEST_PRICE = #{latestPrice,jdbcType=DOUBLE}


    AND CHANGE_AMT = #{changeAmt,jdbcType=DOUBLE}


    AND CHG = #{chg,jdbcType=DOUBLE}


    AND VOLUME = #{volume,jdbcType=BIGINT}


    AND TURNOVER = #{turnover,jdbcType=BIGINT}


    AND AMPLITUDE = #{amplitude,jdbcType=DOUBLE}


    AND HIGH = #{high,jdbcType=DOUBLE}


    AND LOW = #{low,jdbcType=DOUBLE}


    AND OPEN = #{open,jdbcType=DOUBLE}


    AND PREV_CLOSE = #{prevClose,jdbcType=DOUBLE}


    AND RATIO = #{ratio,jdbcType=DOUBLE}


    AND TURNOVER_RATE = #{turnoverRate,jdbcType=DOUBLE}


    AND P_E_RATIO = #{pERatio,jdbcType=DOUBLE}


    AND P_B_RATIO = #{pBRatio,jdbcType=DOUBLE}


    AND LISTING_DATE = #{listingDate,jdbcType=VARCHAR}


    AND CLOSING_PRICE = #{closingPrice,jdbcType=VARCHAR}


    AND DATA_TIME = #{dataTime,jdbcType=TIMESTAMP}
